MainTab:Button{
    Name = 'Win',
    Description = 'Teleports you up to win.',
    Callback = function()
        if plr and char then
            local humanoidRootPart = char:FindFirstChild("HumanoidRootPart")
            if humanoidRootPart then
                humanoidRootPart.CFrame = CFrame.new(-0.4,504,0.7)
                task.wait()
                local finish = game:GetService('Workspace').tower.finishes.Finish
                local player = game.Players.LocalPlayer
                local properties = { CFrame = finish.CFrame, }
                local easingStyle = Enum.EasingStyle.Linear
                local easingDirection = Enum.EasingDirection.Out
                local duration = 1.5
        
                local tween = game:GetService("TweenService"):Create(player.Character.HumanoidRootPart, TweenInfo.new(duration, easingStyle, easingDirection), properties)
                task.wait()
                tween:Play()
            end
        end
    end
}

MainTab:Toggle{
    Name = 'AutoWin',
    Description = 'Automatically teleports you up to win.',
    StartingState = false,
    Callback = function(state)
        _G.autoWin = state
        while _G.autoWin do
            if plr and char then
                local humanoidRootPart = char:FindFirstChild("HumanoidRootPart")
                if humanoidRootPart then
                    humanoidRootPart.CFrame = CFrame.new(-0.4,504,0.7)
                    task.wait()
                    local finish = game:GetService('Workspace').tower.finishes.Finish
                    local player = game.Players.LocalPlayer
                    local properties = { CFrame = finish.CFrame, }
                    local easingStyle = Enum.EasingStyle.Linear
                    local easingDirection = Enum.EasingDirection.Out
                    local duration = 1.5
            
                    local tween = game:GetService("TweenService"):Create(player.Character.HumanoidRootPart, TweenInfo.new(duration, easingStyle, easingDirection), properties)
                    task.wait()
                    tween:Play()
                end
            end
            task.wait(5);
        end
    end
}

MainTab:Toggle{
    Name = 'JumpPower',
    Description = 'Lets you jump higher.',
    StartingState = false,
    Callback = function(state)
        _G.JP = state
        if plr and char then
            local humanoid = char:FindFirstChildOfClass('Humanoid')
            if _G.JP then
                while _G.JP do
                    humanoid.JumpPower = 100
                    task.wait();
                end
            else
                humanoid.JumpPower = 50
                task.wait();
            end
        end
        task.wait();
    end
}

