MainTab:Toggle{
    Name = 'NoHealthDecrease',
    Description = 'Automatically heals you lol.',
    StartingState = false,
    Callback = function(state)
        _G.NHD = state
        if plr and char then
            local humanoid = char:FindFirstChildOfClass('Humanoid')
            if humanoid then
                while _G.NHD do
                    if not _G.NHD then return end
                    humanoid.Health = 100
                    task.wait();
                end
            end
        end
        task.wait();
    end
}

